import React from 'react';
import {useSelector} from "react-redux";
import styles from "./ShowWords.module.css"


const ShowWords = () => {
    const n = useSelector(state => state.WordsReducer)
    let counter = 0;
    return (
        <div className={styles.wrapper}>

            <div>{
                n.map(el => {
                    ++counter
                    return <div key={counter}>
                        <div className={styles.words_container}>
                            <div className={styles.eng_words}>{el.eng}</div>
                            <div>{el.ukr}</div>
                        </div>
                    </div>
                })
            }</div>
        </div>
    )}
    export default ShowWords;
